  false,\n\t\"url\": null,\n\t\"notes\": \"This coverage contains points representing
  monitoring locations on streams, lakes and ponds that have been registered by IOWATER
  monitors. IOWATER, Iowa's volunteer water monitoring program, supports a network
  of volunteers with onsite training workshops, standardized levels of testing, an
  online database to warehouse water quality data collected, and provides testing
  equipment. IOWATER monitors are instructed to use the 7.5' U.S. Geological Survey
  topographic maps available online through the Iowa Geographic Image Map Server (http://ortho.gis.iastate.edu)
  to generate UTM coordinates for their monitoring sites.\",\n\t\"license_title\":
